it‚Äôs been a while since I‚Äôve posted a handwritten poem!! wrote this last night as my hands almost fell off I was so cold sitting reading in the botanic gardens til they closed. might do the same tonight who knows. I hope you like it and I hope you can read it but if not I‚Äôll type it out here too üíú
‚Ä¢
clouds hide the setting sun and I wish this solitude was more fun but it‚Äôs not. instead, fantasies of looking up and seeing you fill my head so I try to distract myself in a book with the words of someone else but nothing works. in my ears is debussy‚Äôs sonata for flute, viola and harp it‚Äôs mostly calming but sometimes sharp, this isn‚Äôt working, I can see myself staying here ‚Äòtil dark. home‚Äôs not far but I can‚Äôt seem to close this chapter, it shouldn‚Äôt be this hard. will I really just sit here ‚Äòtil it‚Äôs dark?

how wonderful it would be for you to spot me reading on a bench underneath a tree and stop to say hi, how‚Äôve you been? but in reality how unlikely this scenario would be and even if by some miracle you do happen to be passing by and see me, we both know you no longer care to hear my answer to how I‚Äôve been. so here I‚Äôll sit as the clouds clear, revealing a sky fading to lilac and my hands turn a similar shade. it‚Äôs terribly cold waiting around for someone who‚Äôll always walk away.
