Silences make the hushed thoughts inside my head suddenly gain volume.
Silences have the tendency to be replaced with unnecessary small talks.
Silences eerily make the deepest darkest corners of my mind come to light.
Silences hold secrets that escape without being discerned. 
Silences are deceptive because they are forsooth the loudest.
